outputFormat:
Up to $ 20 $ times you can ask a query — print an integer from interval $ [2,100] $ in one line. You have to both print the end-of-line character and flush the output. After flushing you should read a response from the input.

In any moment you can print the answer "prime" or "composite" (without the quotes). After that, flush the output and terminate your program.

To flush you can use (just after printing an integer and end-of-line):

- fflush(stdout) in C++;
- System.out.flush() in Java;
- stdout.flush() in Python;
- flush(output) in Pascal;
- See the documentation for other languages.

Hacking. To hack someone, as the input you should print the hidden number — one integer from the interval $ [2,100] $ . Of course, his/her solution won't be able to read the hidden number from the input.

translation:
    这是一道交互题。
    有一个在闭区间[2,100]里面的整数X，你的任务是判断整数x是质数还是合数。
    你可以向系统询问一个数是否为该数的约数，询问方式如下：
    1.你输出一个在闭区间[2,100]里面的整数
    2.系统回答yes或者no(yes表示你输出的数是该数的约数，no表示你输出的数不是该数的约数)
    注意：你最多只能提出20次询问！
    每输出一个询问，你需要使用flush，下面提供一些语言的flush语法：
    C++语言: fflush(stdout)
    JAVA语言: System.out.flush()
    Python语言: stdout.flush()
    Pascal语言: flush(output)

注：以下内容为译者良心添加
    以C++语言为例做一个交互示范(假设x=50):
```
    #include<bits/stdc++.h>
    using namespace std;
    int main()
    {
        char s[10],cnt=0;
        cout<<2<<endl;
        fflush(stdout);
        cin>>s;//此时读入为yes，因为2是50的约数
        if(s[0]=='y') cnt++;
        cout<<25<<endl;
        fflush(stdout);
        cin>>s;//此时读入为yes，因为25是50的约数
        if(s[0]=='y') cnt++;
        if(cnt>=2) cout<<"composite"<<endl;
        fflush(stdout);
        return 0;
    }
```
